import React from "react";
import SkillCard from "./skillcard";

const skills = [{title: "C", icon: ""},
    {},
    {title:"HTML", icon:""},
    {title: "CSS", icon:""},
    {title: "JavaScript",icon: ""},
    {title:"Bootstrap", icon:""},
    {title:"React", icon:""},
    {title: "TailwindCSS",icon:""},
    {title: "Node.js", icon:""},
    {title:"Express.js", icon:""},
    {title: "PostgreSQL", icon :""},
    {title:"MongoDB", icon:""},
    {title: "Git",  icon: ""},
    {title:"Github", icon: ""}
];

function Skills(){
    return(
        // main container 
        <div className="bg-[#443C68]">
            {/* sub-container  */}
            <div className="flex flex-col justify-center">
                {/* heading container  */}
                <div className="flex flex-col justify-center">
                    <h2 className="text-white text-[45px]">Skills</h2>
                </div>

                {/* skill- card conatiner  */}
                <div>
                    {skills.map((skill,index)=>{
                        return(<SkillCard
                            title = {skill.title}
                            icon = {skill.icon}
                            />);
                    })}
                </div>
            </div>
        </div>
    );
}

export default Skills;
